import React from 'react';
import './Home.css';

function Home() {
    return (
        <div className="home">
            <section className="hero">
                <div className="hero-content">
                    <h1>Get My Tickets</h1>
                    <p>A place where you can buy tickets for the concerts you love</p>
                    <a href="#events" className="cta-button">Find Events</a>
                </div>
            </section>

            <main className="container">
                <section className="section events-section" id="events">
                    <h2>Upcoming Events</h2>
                    {/* Add your events content here */}
                    <p>Check out our exciting lineup of upcoming concerts!</p>
                    {/* You can add a list or grid of events here */}
                </section>

                <section className="section about-section" id="about">
                    <h2>About Us</h2>
                    <p>We're passionate about connecting fans with their favorite artists. Our platform makes it easy to find and purchase tickets for the hottest concerts.</p>
                </section>
            </main>

            <footer>
                <p>&copy; 2024 Get My Tickets. All rights reserved.</p>
            </footer>
        </div>
    );
}

export default Home;
